import React from 'react';

const CompMenuNotice = () => {
  return (
    <li>
      <NavLink to='#'>about</NavLink>{/* 링크걸면 알아서 찾아주니까 */}
      <ul>
        <li><NavLink to='/about/notice'>공지사항</NavLink></li>
        <li><NavLink to='/about/online'>자유게시판</NavLink></li>

      </ul>
    </li>
  );
};

export default CompMenuNotice;
